//Global Style
import GlobalStyle from "./components/GlobalStyle";

import AboutUs from "./pages/AboutUs";
import Nav from "./components/Nav";

//Import Pages

function App() {
  return (
    <div className="App">
      <Nav />
      <GlobalStyle />
      <AboutUs />
    </div>
  );
}

export default App;
